Especially in isolation, food is playing a important role with us.  But do we really think why we need to eat?

To receive energy, to be healthy, it tastes good, because where hungry or because food is conveniently sitting there to be eaten. 
Yes food is important, but are we really thinking about what we're putting into our bodies.

The food we eat is a tool we use to maximize optimal health and performance, regards what your training goals are. As well as exercise and recovery, the food we eat is a key component that contributes to our health.

Healthy eating requires really thinking on what we're putting into our mouth. It's about choosing nutritious foods that will help fuel your body. Fine tuning your body's cues, such as hunger, fullness and thirst, can help you develop confidence in your eating and what your body requires, especially in isolation.

